import {View,  Text} from 'react-native-web';

class App extends Component {

constructor(props){

  super(props);
  this.state={
      mensaje:'Hola Mundo',
      variable : ''
  }


}


  render() {
    return (




        <View>
          <Text>
            Hola Mundo
          </Text>
            </View>  

    );
  }
}








export default (App);
